```cpp
#include <OneWire.h>
#include <DallasTemperature.h>

// Define the data pin for the one-wire bus
#define ONE_WIRE_BUS 4

// Create an instance of the OneWire class
OneWire oneWire(ONE_WIRE_BUS);

// Create an instance of the DallasTemperature class
DallasTemperature sensors(&oneWire);

void setup() {
  Serial.begin(115200);
  // Initialize the Dallas Temperature library
  sensors.begin();
}

void loop() {
  // Request temperatures from all sensors
  sensors.requestTemperatures();

  // Get the number of sensors found
  int numSensors = sensors.getDeviceCount();

  // Loop through each sensor and print its address and temperature
  for (int i = 0; i < numSensors; i++) {
    // Get the address of the sensor
    String sensorAddress = sensors.getAddress(i);

    // Get the temperature of the sensor in Celsius
    float temperatureC = sensors.getTempCByIndex(i);

    // Print the sensor address and temperature
    Serial.print("Sensor ");
    Serial.print(i);
    Serial.print(": Address = ");
    Serial.println(sensorAddress);
    Serial.print("Temperature: ");
    Serial.print(temperatureC);
    Serial.println("°C");
  }

  // Wait for a second before reading temperatures again
  delay(1000);
}
```

**Explicación del código:**

1. **Librerías:**
   - `OneWire.h`: Librería para comunicarse con los sensores Dallas 1-Wire.
   - `DallasTemperature.h`: Librería para leer las temperaturas de los sensores Dallas 1-Wire.

2. **Definición de pines:**
   - `ONE_WIRE_BUS`: Define el pin GPIO al que está conectado el bus 1-Wire.

3. **Instancias de clases:**
   - `oneWire`: Objeto de la clase `OneWire` para comunicarse con el bus 1-Wire.
   - `sensors`: Objeto de la clase `DallasTemperature` para leer las temperaturas de los sensores.

4. **Función `setup()`:**
   - Inicializa la comunicación serial a 115200 baudios.
   - Inicializa la biblioteca `DallasTemperature`.

5. **Función `loop()`:**
   - Solicita las temperaturas a todos los sensores conectados.
   - Obtiene el número de sensores encontrados.
   - Recorre cada sensor y:
     - Obtiene la dirección del sensor.
     - Obtiene la temperatura del sensor en grados Celsius.
     - Imprime la dirección y la temperatura del sensor en el monitor serial.
   - Espera un segundo antes de leer las temperaturas nuevamente.

**Para usar este código:**

1. Conecta un sensor Dallas 18B20 al pin GPIO especificado en `ONE_WIRE_BUS`.
2. Carga el código en tu ESP32.
3. Abre el monitor serial en tu software de desarrollo (por ejemplo, Arduino IDE) y observa la salida.

```c
#include <stdio.h>

void bubbleSort(int arr[], int n) {
  int i, j, temp;
  for (i = 0; i < n - 1; i++) {
    for (j = 0; j < n - i - 1; j++) {
      if (arr[j] > arr[j + 1]) {
        // Swap arr[j] and arr[j+1]
        temp = arr[j];
        arr[j] = arr[j + 1];
        arr[j + 1] = temp;
      }
    }
  }
}

int main() {
  int arr[] = {64, 34, 25, 12, 22, 11, 90};
  int n = sizeof(arr) / sizeof(arr[0]);

  printf("Array before sorting: \n");
  for (int i = 0; i < n; i++) {
    printf("%d ", arr[i]);
  }

  bubbleSort(arr, n);

  printf("\nArray after sorting: \n");
  for (int i = 0; i < n; i++) {
    printf("%d ", arr[i]);
  }
  printf("\n");

  return 0;
}
```

**Explicación:**

1. **`bubbleSort(int arr[], int n)`:**
   - Esta función toma un arreglo de enteros `arr` y su tamaño `n` como entrada.

2. **Dos bucles anidados:**
   - El bucle externo itera desde `i = 0` hasta `n - 1`.
   - El bucle interno itera desde `j = 0` hasta `n - i - 1`.

3. **Comparación y intercambio:**
   - En cada iteración del bucle interno, se compara `arr[j]` con `arr[j + 1]`.
   - Si `arr[j]` es mayor que `arr[j + 1]`, se intercambian los elementos usando una variable temporal `temp`.

4. **Iteración y ordenamiento:**
   - Con cada pasada del bucle externo, el elemento más grande se "burbujean" hasta su posición correcta al final del arreglo.
   - El bucle interno se ejecuta una vez menos en cada pasada del bucle externo, ya que el último elemento ya está ordenado.

5. **`main()`:**
   - Define un arreglo de ejemplo `arr`.
   - Calcula el tamaño del arreglo `n`.
   - Imprime el arreglo antes y después de la clasificación.
   - Llama a la función `bubbleSort()` para ordenar el arreglo.

**Nota:**

- El algoritmo `bubble sort` es simple de implementar pero no es eficiente para grandes conjuntos de datos. Su complejidad temporal es O(n^2).

